INSERT INTO `module` (`name`, `header_image`, `preview`, `preview_image`, `content`, `content_image`) VALUES
('Normalizaci√≥n', 'data:image/jpeg;base64,', '<ul style=\"margin-bottom: 0px; letter-spacing: -0.03744px;\"><li>Vistas de una figura. Metodolog√≠a.</li><li>Ejercicios: 30 figuras y soluciones.</li></ul>', 'data:image/png;base64,', '<h1>Normalizaci√≥n en Dibujo T√©cnico</h1>\n    <p>La normalizaci√≥n en dibujo t√©cnico consiste en un conjunto de reglas, convenciones y est√°ndares que se emplean para representar objetos, estructuras o piezas de manera precisa y comprensible en los planos o dibujos t√©cnicos.</p>\n    \n    <h2>Aspectos Clave de la Normalizaci√≥n:</h2>\n    <ol>\n        <li>\n            <strong>Formato y m√°rgenes:</strong> Define las dimensiones del papel, los m√°rgenes y la disposici√≥n del dibujo en la hoja.\n        </li>\n        <li>\n            <strong>L√≠neas y tipos de l√≠neas:</strong> Establece reglas sobre el grosor, longitud y tipo de l√≠neas para representar diferentes elementos en el dibujo.\n        </li>\n        <li>\n            <strong>Escalas:</strong> Determina la relaci√≥n entre las dimensiones reales del objeto y las representadas en el dibujo.\n        </li>\n        <li>\n            <strong>Simbolog√≠a:</strong> Define los s√≠mbolos utilizados para representar caracter√≠sticas espec√≠ficas, como roscas, soldaduras, materiales, etc.\n        </li>\n        <li>\n            <strong>Acotaci√≥n:</strong> Establece normas para indicar las dimensiones del objeto, incluyendo medidas lineales, √°ngulos, tolerancias, entre otros.\n        </li>\n    </ol>\n    \n    <p>La normalizaci√≥n facilita la comunicaci√≥n entre dise√±adores, ingenieros y fabricantes, asegurando la precisi√≥n en la fabricaci√≥n de componentes y estructuras, minimizando errores y garantizando la uniformidad en la producci√≥n.</p>', 'data:image/png;base64,');


INSERT INTO `module` (`name`, `header_image`, `preview`, `preview_image`, `content`, `content_image`) VALUES
('Sistema Di√©drico. Generalidades', 'data:image/jpeg;base64,', '<ul style=\"margin-bottom: 0px; letter-spacing: -0.03744px;\"><li>Introducci√≥n.</li><li>El punto, la recta y el plano. Tercera proyecci√≥n.</li><li>Punto perteneciente a una recta.</li><li>Recta perteneciente a un plano.</li><li>Punto perteneciente a un plano.</li><li>Definir un plano.</li><li>Intersecci√≥n entre dos rectas.</li><li>Intersecci√≥n entre dos planos.</li><li>Intersecci√≥n entre recta y plano.</li><li>Intersecciones con los planos bisectores.</li><li>Paralelismo y perpendicularidad.</li><li>Ejemplos de paralelismo y perpendicularidad.</li></ul>', 'data:image/png;base64,', '<h1>Sistema Di√©drico: Generalidades</h1>\n    <p>El sistema di√©drico es un m√©todo utilizado en dibujo t√©cnico para representar objetos en un espacio tridimensional mediante proyecciones en un plano bidimensional. Se basa en conceptos fundamentales como el punto, la recta y el plano, los cuales son proyectados sobre planos de proyecci√≥n para crear representaciones en dos dimensiones.</p>\n    \n    <p>En este sistema, se trabaja con la proyecci√≥n ortogonal, donde cada punto del espacio tridimensional tiene tres proyecciones sobre tres planos mutuamente perpendiculares: horizontal (H), vertical (V) y frontal (F).</p>\n    \n    <p>La tercera proyecci√≥n es esencial para obtener una representaci√≥n completa y precisa de un objeto. A partir de las proyecciones sobre los tres planos, se pueden determinar relaciones entre puntos, rectas y planos. Esto incluye la pertenencia de un punto a una recta o a un plano, as√≠ como la determinaci√≥n de la recta que pertenece a un plano dado.</p>\n    \n    <p>El sistema di√©drico tambi√©n aborda la definici√≥n de planos mediante sus proyecciones y permite calcular la intersecci√≥n entre diferentes elementos, como dos rectas, dos planos o la intersecci√≥n entre una recta y un plano. Adem√°s, se exploran las intersecciones con los planos bisectores, que son planos que cortan un objeto por la mitad.</p>\n    \n    <p>En el contexto del sistema di√©drico, se establecen conceptos cruciales como el paralelismo y la perpendicularidad entre l√≠neas, planos o ejes. Estos conceptos se aplican para determinar relaciones espaciales y construir representaciones precisas de objetos tridimensionales en dos dimensiones.</p>\n    \n    <p>Los ejemplos de paralelismo y perpendicularidad ayudan a comprender y aplicar estos principios, mostrando c√≥mo identificar y trabajar con l√≠neas o planos que se comportan de manera paralela o perpendicular en el espacio tridimensional y sus proyecciones en el plano bidimensional.</p>\n', 'data:image/png;base64,');


INSERT INTO `module` (`name`, `header_image`, `preview`, `preview_image`, `content`, `content_image`) VALUES
('Sistema Di√©drico. Los m√©todos operativos.', 'data:image/jpeg;base64,', '<ul style=\"margin-bottom: 0px; letter-spacing: -0.03744px;\"><li>Abatimiento de un plano oblicuo.</li><li>Abatimiento por la cota y por afinidad.</li><li>Ejercicios abatimiento plano oblicuo: 01, 02, 03 y 04.</li><li>Abatimientos de todos los planos.</li><li>Ejercicio 05: Abatimiento de un plano paralelo a la LT.</li><li>√Ångulo de trazas de un plano.</li><li>Cambio de plano.</li><li>Giros.</li></ul>', 'data:image/png;base64,', '<h1>Sistema Di√©drico: Los m√©todos operativos</h1>\n    <p>En el sistema di√©drico, el abatimiento implica la representaci√≥n en un plano bidimensional de elementos situados en un plano oblicuo. Se utiliza mediante m√©todos como la cota y la afinidad para representar con precisi√≥n elementos en posiciones no ortogonales.</p>\n    \n    <p>Se realizan ejercicios espec√≠ficos, identificados como 01, 02, 03 y 04, para comprender y aplicar el abatimiento de un plano oblicuo. Adem√°s, se abordan los abatimientos de todos los planos, incluyendo el ejercicio 05 que trata el abatimiento de un plano paralelo a la LT (l√≠nea de tierra).</p>\n    \n    <p>El √°ngulo de trazas de un plano se refiere al √°ngulo formado por las proyecciones del plano sobre los planos de proyecci√≥n (horizontal y vertical). Este √°ngulo es relevante para comprender y trabajar con los cambios de plano, que implican pasar de una proyecci√≥n a otra y realizar giros para obtener diferentes perspectivas de un objeto en el sistema di√©drico.</p>', 'data:image/png;base64,');


INSERT INTO `module` (`name`, `header_image`, `preview`, `preview_image`, `content`, `content_image`) VALUES
('Sistema Di√©drico. Distancias', 'data:image/jpeg;base64,', '<ul style=\"margin-bottom: 0px; letter-spacing: -0.03744px;\"><li>Distancia entre dos puntos.</li><li>Distancia de un punto a un plano.</li><li>Distancia de un punto a una recta.</li><li>Distancia entre dos planos paralelos.</li><li>Distancia entre dos rectas paralelas.</li><li>Distancia entre una recta y un plano paralelos.</li><li>Distancia entre dos rectas que se cruzan.</li><li>Ejercicio 06: Distancia entre dos planos.</li></ul>', 'data:image/png;base64,', '<h1><span style=\"font-size: 3.25rem; letter-spacing: -0.04em; background-color: var(--bs-body-bg); font-family: var(--font-global); text-align: var(--bs-body-text-align);\">Sistema Di√©drico</span>: Distancias</h1>\n    <p>El sistema di√©drico no solo trata la representaci√≥n espacial de objetos, sino que tambi√©n permite calcular distintas distancias entre elementos geom√©tricos. Entre estas distancias se encuentran:</p>\n    \n    <ol>\n        <li><strong>Distancia entre dos puntos:</strong> Se calcula mediante la proyecci√≥n de los puntos sobre los planos de proyecci√≥n y la aplicaci√≥n de f√≥rmulas geom√©tricas.</li>\n        \n        <li><strong>Distancia de un punto a un plano:</strong> Se determina la distancia perpendicular desde un punto hacia un plano, utilizando la proyecci√≥n ortogonal.</li>\n        \n        <li><strong>Distancia de un punto a una recta:</strong> Similar al caso anterior, se establece la distancia perpendicular desde un punto a una recta mediante proyecciones.</li>\n        \n        <li><strong>Distancia entre dos planos paralelos:</strong> Al ser paralelos, se utiliza la proyecci√≥n ortogonal para calcular la distancia entre ambos planos.</li>\n        \n        <li><strong>Distancia entre dos rectas paralelas:</strong> Se aplica una proyecci√≥n para calcular la distancia entre dos rectas que son paralelas en el espacio tridimensional.</li>\n        \n        <li><strong>Distancia entre una recta y un plano paralelos:</strong> La distancia entre una recta y un plano paralelo a ella se obtiene mediante proyecciones ortogonales.</li>\n        \n        <li><strong>Distancia entre dos rectas que se cruzan:</strong> Si las rectas se cruzan en el espacio tridimensional, se calcula su distancia aplicando proyecciones y f√≥rmulas espec√≠ficas.</li>\n        \n        <li><strong>Ejercicio 06: Distancia entre dos planos:</strong> Este ejercicio espec√≠fico probablemente involucra la aplicaci√≥n pr√°ctica de las f√≥rmulas y conceptos relacionados con la distancia entre dos planos.</li>\n    </ol>\n    \n    <p>Estos c√°lculos de distancias en el sistema di√©drico son fundamentales para determinar relaciones espaciales precisas entre distintos elementos geom√©tricos en el dibujo t√©cnico.</p>', 'data:image/png;base64,');